    reported. Those issues have been addressed.  Also, the remaining 441ad authority
    was transfered from the DSCC and DCCC respectively.     3.  The receipt on Line
    15 from Madison County DEC was to reimburse the Committee for the Committee's
    portion of a general mailing that was done.  The receipt from Roseanne Byrne on
    the same line was to reimburse the Committee for lodging expenses paid on her
    behalf. She was not reported because the original payment was made to the hotel
    directly.  This hotel cost was not a Committee expense and a reimbursement was
    due.    4.  The Committee has added additional employer and occupations for donor
    records on this report.  The Committee has a best efforts practice were the donor
    information is requested at the time of solicitaion and  the required disclaimer
    is on all written solicitations. When a donation is received without the correct
    information, the donor is contacted via e-mail, telephone, or mail, depending
    on the Committee's relationship with the donor.  If the information is received
    on a later date it will be provided to the Commission.    3.  All transfers to
    the Non Federal Account were for Cash Flow purposes and the funds were not used
    to fund Federal Activity.            4.  All transfers from National Committees
